async function fetchUsersList() {
  try {
    fetch('https://fakestoreapi.com/products')
      .then(res=> res.json())
      .then(json=> {
        return json
      })
  } catch (error) {
    console.log(error);
  }
}

const userServices = {
 fetchUsersList
};

export default userServices;
